import React from "react";

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>House</th>
      </tr>
    </thead>
  );
};

const TableBody = () => {
  return (
    <tbody>
      <tr>
        <td>Harry Potter</td>
        <td>Gryffindor</td>
      </tr>
    </tbody>
  );
};

class Table extends React.Component {
  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>House</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Harry Potter</td>
            <td>Gryffindor</td>
          </tr>
          <tr>
            <td>Ron Weasley</td>
            <td>Gryffindor</td>
          </tr>
          <tr>
            <td>Draco Malfoy</td>
            <td>Slytherin</td>
          </tr>
          <tr>
            <td>Cho Chang</td>
            <td>Ravenclaw</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
